      desc: данная модель была выведена на рынок в далеком 2010-м году. Это револьвер 357-го калибра нетипичной конструкции. Выстрел производится с нижней каморы барабана, соответственно, ствол расположен низко, относительно прицельной линии. Это ослабляет отдачу и уменьшает подброс ствола. В этом году вышла вариация с отделкой алюминиевой рамы, барабана и ствола в расцветку Nebula. Эксперты отметили, что эта модель была самой удобной для стрельбы мощными боеприпасами. Однако премиум-цену они посчитали завышенной.
